import { ComponentProps } from "./types";

const Timer: React.FC<ComponentProps> = () => {
  const [state, setState] = useState("00:00");

  useEffect(() => {
    console.log(state);
  });

  return (
    <>
      <h3>{state}</h3>
      <button onClick={() => setState("02:00")}>Click</button>
    </>
  );
};

export default Timer;
